import React from "react";
import ReactDOM from 'react-dom';

let Name = "Himanshu";
let d = new Date();
let Datee = new Date().toLocaleDateString();
let Time = new Date().toLocaleDateString();

ReactDOM.render(

    <>

        <h1>My Name Is {Name}</h1>
        <p>Current Date is {`${d.getDate()}/${d.getMonth()}/${d.getFullYear()}`}</p>
        <p>Date {Datee}</p>
        <p>Current Time is {`${d.getHours()}:${d.getMinutes()}:${d.getSeconds()} ${d.getHours() < 12 ? "A.M" : "P.M"}`}</p>
        <p>Time {Time}</p>
    </>,
    document.getElementById('root')
);
